INSERT INTO `hospitals` (`id`, `name`, `description`, `Address`, `createdon`, `image`) VALUES
(4, 'KRTK Hospital', 'KRTK is the best hospital in Karimnagar and also the leading providers of healthcare in Telangana region and has been serving the community for more than 15 years by providing comprehensive treatment for the patients. The Multi Super Speciality Hospital holds 150 beds and is spread over 1,00,000 sq.ft with modern state of art facilities and is also a leading minimal invasive surgery centre opened its new premises in August 2017.', 'karimnagar', '2023-01-04 17:29:45', );

